"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[8578],{1912:(s,t,o)=>{o.r(t),o.d(t,{assets:()=>c,contentTitle:()=>i,default:()=>p,frontMatter:()=>e,metadata:()=>r,toc:()=>l});var n=o(4848),a=o(8453);const e={title:"Como baixar e instalar o sistema Facity?"},i=void 0,r={id:"cadastros/como-baixar-e-instalar-o-sistema-facity-",title:"Como baixar e instalar o sistema Facity?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/cadastros/como-baixar-e-instalar-o-sistema-facity-.mdx",sourceDirName:"cadastros",slug:"/cadastros/como-baixar-e-instalar-o-sistema-facity-",permalink:"/en/docs/cadastros/como-baixar-e-instalar-o-sistema-facity-",draft:!1,unlisted:!1,tags:[],version:"current",frontMatter:{title:"Como baixar e instalar o sistema Facity?"},sidebar:"tutorialSidebar",previous:{title:"Como baixar e instalar o Anydesk?",permalink:"/en/docs/cadastros/como-baixar-e-instalar-o-anydesk-"},next:{title:"Como cadastrar combos?",permalink:"/en/docs/cadastros/como-cadastrar-combos-"}},c={},l=[];function g(s){return(0,n.jsx)(n.Fragment,{children:(0,n.jsx)(n.Fragment,{children:(0,n.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p class="has-small-font-size">Para come\xe7ar, voc\xea precisar\xe1 realizar a instala\xe7\xe3o do programa, onde ocorre a configura\xe7\xe3o do sistema. O processo \xe9 bastante simples e voc\xea mesmo pode executar seguindo os passos a seguir:</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1: Download e Instala\xe7\xe3o do Programa</strong></p>\n\n\n\n<p class="has-small-font-size">    <strong>1.1</strong> &#8211; Acesse o link abaixo e quando abrir a pagina clique em <strong>&#8220;Instalador Facity Controle Cliente Web&#8221;.</strong></p>\n\n\n\n<p class="has-small-font-size">                    ??   <a href="https://www.facity.com.br/downloads">https://www.facity.com.br/downloads</a></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/Opera-Instantaneo_2023-11-17_183713_www.facity.com_.br_.png" alt="" class="wp-image-1539" width="807" height="338" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/Opera-Instantaneo_2023-11-17_183713_www.facity.com_.br_.png 899w, https://blog.facity.com.br/wp-content/uploads/2023/11/Opera-Instantaneo_2023-11-17_183713_www.facity.com_.br_-300x126.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/Opera-Instantaneo_2023-11-17_183713_www.facity.com_.br_-768x322.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/Opera-Instantaneo_2023-11-17_183713_www.facity.com_.br_-720x302.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">       <strong>1.2</strong> &#8211; Clique no link para iniciar o download. Dependendo do seu navegador, uma nova guia pode abrir automaticamente para salvar o arquivo ou iniciar o download.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/0000000000000000000000.png" alt="" class="wp-image-1541" width="805" height="392" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/0000000000000000000000.png 760w, https://blog.facity.com.br/wp-content/uploads/2023/11/0000000000000000000000-300x146.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/0000000000000000000000-720x351.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">       <strong>1.3</strong> &#8211; Ap\xf3s o<strong> download</strong>, abra o arquivo <em>(clicando onde a seta indica na imagem a cima)</em>. Se o antiv\xedrus mostrar uma mensagem de prote\xe7\xe3o, clique em <strong>&#8220;Mais informa\xe7\xf5es&#8221;</strong> e selecione <strong>&#8220;Executar mesmo assim&#8221;</strong>.  </p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_190228636.png" alt="" class="wp-image-1542" width="800" height="413" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_190228636.png 681w, https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_190228636-300x155.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">      <strong> 1.4 </strong>&#8211; Na tela de instala\xe7\xe3o, escolha entre &#8220;<strong>Instala\xe7\xe3o Completa</strong>&#8221; (instala o sistema e o servidor de impress\xe3o) ou &#8220;<strong>Instala\xe7\xe3o Parcial</strong>&#8221; (instala apenas o sistema). Clique em &#8220;<strong>Pr\xf3xima</strong>&#8221; at\xe9 chegar \xe0 op\xe7\xe3o &#8220;<strong>Instalar</strong>&#8220;.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_191215063.png" alt="" class="wp-image-1543" width="788" height="281" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_191215063.png 690w, https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-17_191215063-300x107.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="794" height="498" src="https://blog.facity.com.br/wp-content/uploads/2023/11/333.png" alt="" class="wp-image-1544" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/333.png 794w, https://blog.facity.com.br/wp-content/uploads/2023/11/333-300x188.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/333-768x482.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/333-720x452.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">    <strong>1.5</strong> &#8211; Aguarde a conclus\xe3o da instala\xe7\xe3o e, em seguida, insira o <strong>nome da sua empresa </strong>em <strong>letras min\xfasculas </strong>quando solicitado. Clique em <strong>&#8220;Salvar&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/444444.png" alt="" class="wp-image-1545" width="793" height="388" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/444444.png 686w, https://blog.facity.com.br/wp-content/uploads/2023/11/444444-300x147.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2: Programas Instalados na \xc1rea de Trabalho</strong></p>\n\n\n\n<p class="has-small-font-size">Na conclus\xe3o da instala\xe7\xe3o, os seguintes programas estar\xe3o dispon\xedveis em sua \xe1rea de trabalho:</p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li><strong>Rusdesk</strong> (acesso remoto)</li><li><strong>Facity Pos</strong></li><li><strong>Facity Controle</strong></li><li><strong>Facity Impressor</strong></li></ul>\n\n\n\n<p><em>Imagem dos dos programas mencionados:</em></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/55555.png" alt="" class="wp-image-1546" width="821" height="324" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/55555.png 633w, https://blog.facity.com.br/wp-content/uploads/2023/11/55555-300x118.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3: Configura\xe7\xe3o do Facity Impressor</strong></p>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size">    <strong>2.1</strong> &#8211; Abra o programa<strong> Facity Impressor</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/impressor1.png" alt="" class="wp-image-1547" width="866" height="342" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/impressor1.png 633w, https://blog.facity.com.br/wp-content/uploads/2023/11/impressor1-300x118.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">      <strong>2.2 </strong>&#8211; Clique em<strong> &#8220;Configurar Conex\xe3o&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="872" height="561" src="https://blog.facity.com.br/wp-content/uploads/2023/11/01.png" alt="" class="wp-image-1548" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/01.png 872w, https://blog.facity.com.br/wp-content/uploads/2023/11/01-300x193.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/01-768x494.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/01-720x463.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">      <strong> 2.3 </strong> &#8211;  Escolha <strong>&#8220;Online&#8221; </strong>e clique em <strong>login</strong>. </p>\n\n\n\n<p class="has-small-font-size">Se estiver <strong>reinstalando</strong>, insira o <strong>ID do impressor</strong> encontrado no Facity Controle em &#8220;Configura\xe7\xe3o de Impressor&#8221;. Clique em <strong>&#8220;Trocar a Hash&#8221;</strong>, insira a senha <strong>&#8220;123456&#8221; </strong>e salve antes de copiar o c\xf3digo para colar na configura\xe7\xe3o do Facity Impressor.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="821" height="582" src="https://blog.facity.com.br/wp-content/uploads/2023/11/02-1.png" alt="" class="wp-image-1550" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/02-1.png 821w, https://blog.facity.com.br/wp-content/uploads/2023/11/02-1-300x213.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/02-1-768x544.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/02-1-677x480.png 677w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">  <strong> 2.4 </strong>&#8211;  Insira o <strong>nome da empresa</strong>,<strong> login </strong>e <strong>senha </strong>na nova aba que se abrir\xe1. Clique em <strong>&#8220;Logar&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/03.png" alt="" class="wp-image-1551" width="811" height="514" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/03.png 920w, https://blog.facity.com.br/wp-content/uploads/2023/11/03-300x190.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/03-768x487.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/03-720x456.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">  <strong>2.5</strong> &#8211; Retorne \xe0 tela principal do Impressor, clique em <strong>&#8220;Configura\xe7\xf5es Gerais&#8221;</strong> e selecione <strong>&#8220;Buscar do Administrativo&#8221;</strong>. Insira as informa\xe7\xf5es solicitadas e clique em <strong>&#8220;Salvar&#8221;</strong></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_194851644.png" alt="" class="wp-image-1552" width="810" height="455" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_194851644.png 687w, https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_194851644-300x169.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4: Adi\xe7\xe3o de Impressoras de Terminal e Produ\xe7\xe3o</strong></p>\n\n\n\n<p class="has-small-font-size">  <strong>4.1</strong> &#8211; Na tela inicial, clique em <strong>&#8220;Parar o Servidor&#8221; </strong>e selecione <strong>&#8220;Impressora de Terminal&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_200236677.png" alt="" class="wp-image-1553" width="797" height="315" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_200236677.png 696w, https://blog.facity.com.br/wp-content/uploads/2023/11/imagem_2023-11-25_200236677-300x119.png 300w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">  <strong>4.2 </strong>&#8211; Escolha o <strong>terminal</strong>(1), modelo da impressora em <strong>&#8220;Impressora de Destino&#8221;</strong>(2), selecione o <strong>&#8220;Modelo&#8221;</strong>(3), marque <strong>&#8220;Negrito&#8221;</strong> e <strong>&#8220;Cortar&#8221;</strong>. Clique em <strong>&#8220;Adicionar&#8221;</strong>(4) e <strong>salve</strong>(5) as configura\xe7\xf5es.</p>\n\n\n\n<p>Lembre de escolher o &#8220;Modelo&#8221; dependendo da marca da sua impressora.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="934" height="523" src="https://blog.facity.com.br/wp-content/uploads/2023/11/06.png" alt="" class="wp-image-1554" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/06.png 934w, https://blog.facity.com.br/wp-content/uploads/2023/11/06-300x168.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/06-768x430.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/06-720x403.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">  <strong>4.3 </strong>&#8211; Repita o mesmo processo para <strong>&#8220;Impressora de Produ\xe7\xe3o&#8221;</strong>, selecionando a<strong> &#8220;Impressora de Origem</strong>&#8220;(1), a <strong>&#8220;Impressora de destino&#8221;</strong>(2), o <strong>&#8220;Modelo&#8221;</strong>(3) , marcando <strong>&#8220;Negrito&#8221;</strong> e<strong> &#8220;Cortar&#8221;</strong>. Clique em <strong>&#8220;Adicionar&#8221;</strong>(4) e<strong> salve </strong>(5) as configura\xe7\xf5es.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="871" height="592" src="https://blog.facity.com.br/wp-content/uploads/2023/11/07.png" alt="" class="wp-image-1556" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/07.png 871w, https://blog.facity.com.br/wp-content/uploads/2023/11/07-300x204.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/07-768x522.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/11/07-706x480.png 706w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5: Iniciar o Servidor</strong></p>\n\n\n\n<p class="has-small-font-size"><strong> 5.1</strong> &#8211; Ap\xf3s configurar as impressoras, clique em<strong> &#8220;Iniciar Servidor&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/11/08.png" alt="" class="wp-image-1557" width="879" height="639" srcset="https://blog.facity.com.br/wp-content/uploads/2023/11/08.png 738w, https://blog.facity.com.br/wp-content/uploads/2023/11/08-300x218.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/11/08-660x480.png 660w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"> Se as impressoras estiverem corretamente selecionadas, o processo estar\xe1 completo. Caso encontre dificuldades, entre em contato com o suporte t\xe9cnico para assist\xeancia adicional. Agora, desfrute do controle eficiente e simplificado do <strong>Facity Controle Cliente Web </strong>em sua empresa!</p>\n\n'}})})})}function p(s={}){const{wrapper:t}={...(0,a.R)(),...s.components};return t?(0,n.jsx)(t,{...s,children:(0,n.jsx)(g,{...s})}):g()}},8453:(s,t,o)=>{o.d(t,{R:()=>i,x:()=>r});var n=o(6540);const a={},e=n.createContext(a);function i(s){const t=n.useContext(e);return n.useMemo((function(){return"function"==typeof s?s(t):{...t,...s}}),[t,s])}function r(s){let t;return t=s.disableParentContext?"function"==typeof s.components?s.components(a):s.components||a:i(s.components),n.createElement(e.Provider,{value:t},s.children)}}}]);